import Link from 'next/link';

function Container({ children }) {
  return (
    <div className="container mx-auto">
      <Link href="/">
        <a className="px-2 py-6">Index</a>
      </Link>
      <Link href="/about">
        <a className="px-2 py-6">About</a>
      </Link>
      {children}
    </div>
  );
}

export default Container;
